import React from "react";
import { StatusBar } from "expo-status-bar";
import {
	StyleSheet,
	Text,
	View,
	Image,
	SafeAreaView,
	ScrollView,
	TouchableHighlight,
	TouchableOpacity,
} from "react-native";

import AccountElement from "../components/account-element";
import { useDispatch, useSelector } from "react-redux";
export default function Account({ navigation }) {
	const dispatch = useDispatch();
	const handleLogOut = () => {
		alert("Log Out clicked");
	};

	const selectAccountScreenHandler = name => {
		navigation.navigate(name);
	};

	return (
		<SafeAreaView>
			<View style={styles.marginContainer}>
				<Text style={styles.name}>Mateo Rubinstein</Text>
				<TouchableOpacity style={styles.logOutButton} onPress={handleLogOut}>
					<Text style={styles.logOutText}>Log Out</Text>
				</TouchableOpacity>
				<TouchableOpacity onPress={() => selectAccountScreenHandler("Wallet")}>
					<AccountElement name="Account" />
				</TouchableOpacity>
				<AccountElement
					name="Wallet"
					onPress={() => selectAccountScreenHandler("Wallet")}
				/>
				<AccountElement
					name="Settings"
					onPress={() => navigation.navigate("Settings")}
				/>

				<View style={styles.bottomElements}>
					<AccountElement name="Security measures" bottomTab={true} />
					<AccountElement name="About" bottomTab={true} />
				</View>
			</View>
		</SafeAreaView>
	);
}

const styles = StyleSheet.create({
	container: {
		flex: 1,
		backgroundColor: "#fff",
	},
	marginContainer: {
		marginHorizontal: "3%",
		padding: 8,
	},
	name: {
		fontSize: 30,
		fontWeight: "500",
	},
	logOutButton: {
		marginVertical: 7,
	},
	logOutText: {
		color: "#FF267C",
	},
	bottomElements: {
		marginTop: 400,
	},
});
